<script>
  var $context = $(".cards-scroll");
  var $input = $("#myInput");
  $input.keypress(function (e) {
	if(e.which == 13)  // the enter key code
	{
		var input = document.getElementById("myInput");
		var filter = input.value.toLowerCase();
		var nodes = document.getElementsByClassName('card-moon__info');
		for (i = 0; i < nodes.length; i++) {
			if (nodes[i].innerText.toLowerCase().includes(filter)) {
			  nodes[i].style.display = "flex";
			} else {
			  nodes[i].style.display = "none";
			}
		}

		var findText = $input.val();
		$context.unhighlight().highlight(findText, {
			element: "span",
			className: 'highlight',
		});

		var offset = $('span.highlight').offset();
		$context.animate({scrollTop: offset.top - 290});

		false;  
	}
  }); 
</script>




